import logo from './logo.svg';
import './App.css';
import Hauptseite from './pages/Hauptseite';
import Navbar from './components/navbar';
import Booknow from './components/booknow';

function App() {
  return (
    <div className="App">
      <header>
        <Navbar/>
      </header>
      <div>
        <Hauptseite/>
        <Booknow/>
    </div>
    </div>
  );
}

export default App;
